import React from "react";

function Columns({ column }) {
  // Accessing the values from the column prop
  const { column_name, data_type } = column;
  return (
    <div>
      <tr className="column-row">
        <td>{column_name}</td>
        <td>{data_type}</td>
      </tr>
    </div>
  );
}

export default Columns;
